import React from 'react';
import MagicGrid from 'magic-grid';
import MG from 'react-magic-grid';



function MGtest() {
    const Cards = ({ cards }) => (
        <MagicGrid items={cards.length}>
            {cards.map(item => (
            <Card key={item} item={item} />
            ))}
        </MagicGrid>
    )

    return (
        <div>
             <div id="container">
                <MagicGrid static gutter={12}> {/*요소 간격*/}
                    <Card style={{backgroundColor:"rgb(255, 205, 0)"}} name="&nbsp;" />
                    <Card name="&nbsp;" />
                    <Card name="&nbsp;" />
                    <Card name="&nbsp;" />
                </MagicGrid>
            </div>
        </div>
    );
}

export default MGtest;
